import React from "react";
import * as S from './App.styles'

const Login = () => {
    return(
        <div className="container">
                <S.HeaderLogin>
                    <S.Title>Iphones do Nairobi</S.Title>
                </S.HeaderLogin>
            <S.FormsLogin>
                <p></p>
            </S.FormsLogin>
        </div>
    )
}

export default Login
